import React, { useState } from "react";
import FilterBar from "../components/Filter";

export default function Admin() {
  return (
    <div className="admin-page">
      <FilterBar title="Admin" />
      <div className="flex justify-center m-5">
        <div className="w-1/2 flex justify-around bg-gray p-4 rounded-md">
          <a href="/admin/users" className="bg-darkgray p-3 rounded-md">
            Add Category
          </a>
          <a
            href="/admin/roles"
            className={`${
              select === 1 ? bg - darkgray : bg - gray
            } p-3 rounded-md`}
          >
            Add Product
          </a>
          <a href="/admin/settings" className="bg-gray p-3 rounded-md">
            User
          </a>
        </div>
      </div>
    </div>
  );
}
